import React from 'react';
import { Link } from 'react-router-dom';

import { Menu } from 'antd';

const NavBar = () => {
	return (
		<div>
			<Menu mode='horizontal'>
				<Menu.Item onClick={() => clicked()}>
					<Link to='/'>Home</Link>
				</Menu.Item>
				<Menu.Item>
					<Link to='/coffee'>Coffee</Link>
				</Menu.Item>
				<Menu.Item>About</Menu.Item>
			</Menu>
		</div>
	);
};

export default NavBar;
